import React, { Component } from 'react';
import './skills.css';
import Aos from 'aos';
import 'aos/dist/aos.css';
import Img from './f.jpg';

Aos.init({
 duration: 1200
});

class Skills extends Component {

  render() {
    return (
    	<div id='skills'>
            <div className='parallax' style={{backgroundImage:'url(' + Img + ')'}}></div>

            <h1 style={{position:'absolute',top:40,left:560}}>MY SKILLS</h1>

            <h4 style={{position:'absolute',top:163,left:110,color:'white'}}>HTML</h4>
    		<div className="myProgress" style={{top:200,left:100}}>
                <div className="myBar" data-aos="new-animation">80%</div>
            </div>
            <h4 style={{position:'absolute',top:270,left:110,color:'white'}}>HTML</h4>
            <div className="myProgress" style={{top:300,left:100}}>
                <div className="myBar" data-aos="new-animation">70%</div>
            </div>
            <div className="myProgress" style={{top:400,left:100}}>
                <div className="myBar">90%</div>
            </div>
            <div className="myProgress" style={{top:200,left:700}}>
                <div className="myBar">30%</div>
            </div>
            <div className="myProgress" style={{top:300,left:700}}>
                <div className="myBar">60%</div>
            </div>
            <div className="myProgress" style={{top:400,left:700}}>
                <div className="myBar">80%</div>
            </div>

    	</div>
    );
  }
}

export default Skills;
